	public String check(String s)
	{
		String[] st = s.split(" ");
		boolean ok = true;
		if (s.startsWith(" ") || s.endsWith(" ")) ok = false;
		for (String w : st)
			if (!"buffalo".equals(w)) ok = false;;
		
		return ok ? "Good" : "Not good";		
	}
	
